let disabledDatePickerIconInstance = null;
module.exports = class disabledDatePickerIcon {

    constructor() {
        if (!disabledDatePickerIconInstance) {
            disabledDatePickerIconInstance = this;
            //set all other default values

            this.displayAs = 'Disabled Icon';
            this.value = '[disabledDatepickerIcons]'
            this.type = 'TOGGLE';
            this.values = {'true-value':'true', 'false-value': 'false'}
        }
        return disabledDatePickerIconInstance;
    }
}